import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from '../../Components/Navbar/Navbar';
import Home from '../../Components/Home/Home';

import JavaScriptQuestions from '../../Pages/JavaScriptQuestions/JavaScriptQuestions';
import ReactQuestions from '../../Pages/ReactQuestions/ReactQuestions';
import NodeQuestions from '../../Pages/NodeQuestions/NodeQuestions';


const Header = () => {
	const javaScriptSources = [];

	return (
		<Router>
			<Navbar />
			<Routes>
				<Route path="/" element={<Home />} />
				<Route path="/javascript" element={<QuestionsPage topic="javascript" />} />
				<Route path="/react" element={<ReactQuestions />} />
				<Route path="/node" element={<NodeQuestions />} />
			</Routes> 
		</Router>
	);
}

export default Header;
